script: |
  super -f text -I q393.spq | sort > q393.out

inputs:
  - name: q393.spq
    data: |
      SELECT DISTINCT - + ( + - col2 ) AS col2 FROM tab0 (FORMAT parquet) WHERE - ( 32 ) * 43 + + - 20 - + - ( col1 ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q393.out
    data: |
      10
      47
      99
